import './App.css';
import Welcome from './Components/Menu';

import{BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/" element={<Welcome/>} />>
      </Routes>
    </Router>

  );
}

export default App;
